import React from "react";
import "./Nav.css";
import github from "./images/github-logo.png";

function Nav() {
  return (
    <div className="Nav">
      <img src={github} className="Github" alt="github"></img>

      <div className="Nav-links">
        <li>
          <a href="#bottom">About Me</a>
        </li>
        <li>
          <a href="#bottom">Projects</a>
        </li>

        <li>
          <a href="#bottom">Resume</a>
        </li>
        <li>
          <a href="#bottom">Contact</a>
        </li>
      </div>
    </div>
  );
}

export default Nav;
